import React, { Component } from 'react'

export class Notes extends Component {
    constructor(props){
        super(props);
        this.state = {
            notes : []
        }
    }
    
    componentDidMount(){
        fetch('localhost:5000/')
            .then(res => res.json())
            .then(notes => this.setState({notes}));
    }

    render() {
        return (
            <div>
                <h2>Notes</h2>
                <ul>
                    {this.state.notes.map(note =>
                        <li key={note.id}>
                            <h3>{note.title}</h3>
                            <p>{note.desc}</p>
                        </li>
                        )}
                </ul>
            </div>
        )
    }
}

export default Notes
